import React from 'react';

class Footer extends React.Component {
    render() {
        return (
            <div className="footer">
                <div className="address"></div>
                <div className="timings"></div>
                <div className="contact"></div>
                <div className="follow"></div>
            </div>
        );
    }
}

export default Footer;
